          $this->addSql("INSERT INTO employee_basic_info
                         (employee_no, f_name, s_name, t_name, l_name, en_name, gender, religion, birthday, birthplace, nationality, national_id
                         , passport_no, marital_status, employee_status, disability, disability_desc,attendance_agreements_id, password, active ) 
                         SELECT 
