                             ,split_part(emp_a_name, ' ', 2) 
                             ,split_part(emp_a_name, ' ', 3) 
                             ,split_part(emp_a_name, ' ', 4)
                             , COALESCE(EMP_L_NAME,'')
                             , CAST(GENDER AS INTEGER)
                             ,COALESCE(CAST(RELIGION AS INTEGER),1) 
