                             , 1
                             , '$pass' 
                             , true
                         FROM 
                             att_emp
                         WHERE 
                             EMP_ID != '168139' ");


        $this->addSql("INSERT INTO employee_addresses_info
                        (employee_id, address, city, region, street, postal_code) 
                    SELECT 
                      employee_basic_info.id
                    , COALESCE(att_emp.address,'')
                    , CASE att_emp.city_no 
                            WHEN '103' THEN 1
                            WHEN '101' THEN 2
                            WHEN '102' THEN 3
                            WHEN '106' THEN 4
                            WHEN '107' THEN 5
                            WHEN '105' THEN 6
                            WHEN '108' THEN 7
                            WHEN '109' THEN 8
                            WHEN '114' THEN 9
                            WHEN '115' THEN 10
                            WHEN '104' THEN 12
                            WHEN '113' THEN 13
                            WHEN '11' THEN  14
                            WHEN '111' THEN 15
                            WHEN '110' THEN 16
                            ELSE 0
                        END city
                
                    , ''
                    , ''
                    , ''
                    FROM
                        att_emp
                    , employee_basic_info
                    WHERE
                        CAST(att_emp.emp_id AS INTEGER) = employee_basic_info.employee_no  "
                    );    


